import logo from './logo.svg';
import './Login.css';
import { createMuiTheme,ThemeProvider  } from '@material-ui/core/styles';
import React from "react";
import {
Button,
TextField,
Grid,
Paper,
AppBar,
Typography,
Toolbar,
Link,
} from "@material-ui/core";
import { makeStyles } from "@material-ui/core/styles";
const useStyles = makeStyles((theme) => ({
  customBorderRadius: {
    borderRadius: 5,
    width: '396px',
    padding: '30px 0px 28px',
    margin: '40% auto',
    textAlign: 'center',
    alignItems: 'center',
  },
  customTextBox:
  {
    width: '90%',
  }
}));

const theme = createMuiTheme({

  typography: {
    fontFamily: ['"Montserrat Medium"'].join(','),
    button:
    {
      textTransform: 'none',
      width:'90%',
      palette:
      {
        primary: '#FBBD14'
      }
    },
   },
 },
)


function LoginForm()
{
  const classes = useStyles();
  return (
    <div className="loob">
        <ThemeProvider theme={theme}>
          <Paper variant="elevation" elevation={10} className={classes.customBorderRadius}>
          <Grid container direction="row" spacing={0} className="test">
          <Grid item>
            <div className="sign">
                Don't have an account yet? </div>
                </Grid>
                <Grid item>
              <Link href="#">
              <div  className="sign-link">
              Sign Up!
              </div>
              </Link>
                </Grid>
            </Grid>
            <Grid container direction="column" spacing={2} >

              <Grid item>
                <TextField
                  id="outlined-email"
                  label="Email"
                  variant="outlined"
                  className = {classes.customTextBox}
                  // inputProps={{style: {fontSize: 40}}} // font size of input text
                  // InputLabelProps={{style: {fontSize: 40}}} // font size of input label
                />
              </Grid>
              <Grid item>
                <TextField
                  id="outlined-pw"
                  label="Password"
                  type="password"
                  variant="outlined"
                  className = {classes.customTextBox}
                />
              </Grid>
              <Grid item>
              <Button
              variant="contained"              
              type="submit"
              className="button-block"
              style = {{background: '#FBBD14',
                        color:'#FFFFFF',
                        fontFamily:'Montserrat SemiBold',
                        fontSize: '16px'}}
              >
                Login
              </Button>

              </Grid>
              <Grid item>
              <Link href="#" className="fpw">
              Forgot Password?
              </Link>
                </Grid>
            </Grid>
          </Paper>
          </ThemeProvider>
          </div>
  );
}
function Login() {
  const classes = useStyles();
  const [checked, setChecked] = React.useState(false);

  const handleChange = () => {
    setChecked((prev) => !prev);
  };

  return (
    <div className="main">
       <FormControlLabel
        control={<Switch checked={checked} onChange={handleChange} />}
        label="Show"
      />
      <Grid container justify="center" direction="row" className="login-form">
      <Grid item>
          <Grid container justify="center" direction="column" className="logo-comp">
            <Grid item>
              <img src={logo} className="App-logo" alt="logo" />
            </Grid>
            <Grid item>
              <h1 class="large">
              ipon.app
              </h1>
            </Grid>
            <Grid item>
            <p class="tag-large">
            Simplest way to track your expenses.
            </p>
            </Grid>

            <Grid item>
            <p class="tag-next-large">
              Because every peso counts.
            </p>
            </Grid>
          </Grid>
        </Grid>
        <Grid item>
          <LoginForm/>
        </Grid>
      </Grid>
  </div>
  );
}

export default Login;
